import React from "react"
import { Checkbox, Label, IconButton, Icon } from "monday-ui-react-core"
import { RecycleBin } from "monday-ui-react-core/icons" 
import { useState, useEffect } from "react";

const ListItem = ({itemName}) => {
    const [isChecked, setIsChecked] = useState(false);




    return (
        <div className="container align-middle">
            <div className="row">
            <div className="col-6">
                <Checkbox className="align-middle" onChange={() => setIsChecked(!isChecked)} checked={isChecked} disabled={isChecked} label={itemName}></Checkbox>
            </div>

            <div className="col-6">
                <Label text="123" color={Label.colors.Dark} kind={Label.kinds.LINE}></Label>
            </div>
            </div>

        </div>
    );
}

export default ListItem
